import React from "react";
import { render } from "@testing-library/react";

class NavItem extends React.Component {

  setActive = (e) => {
    console.log(e.target.id);
  };
  render(){
    console.log(props.active, props.value);
    let Class = "NavItem";
    if (props.value === props.active) {
        Class = "NavItem active";
    }
    return <div className={Class} id={parseInt(props.value.toString())}>{props.value}</div>;

  }
}

class Header extends React.Component {

  render() {
    const numbers = this.props.numbers;
    const activeIndex = this.props.activeId;
    const NavItemList = numbers.map((number) => (
      <NavItem key={number.toString()}  value={number}  onClick={this.setActive}/>
    ));
    return (
      <div className="navBar">
        <div className="Nav">{NavItemList}</div>
      </div>
    );
  }
}

export default Header;
